"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Pityriasis rosea (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/pityriasis-rosea-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H26584895\">",
"      <span class=\"h1\">",
"       What is pityriasis rosea?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Pityriasis rosea is a harmless skin rash that causes small, itchy spots on the belly, back, chest, arms, and legs. The rash usually lasts about 4 to 6 weeks, but in some people, it can last for months.",
"     </p>",
"     <p>",
"      Pityriasis rosea is most common in older children and young adults.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H26584910\">",
"      <span class=\"h1\">",
"       What causes pityriasis rosea?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The cause is not known. But it does not seem to be easily spread from person to person.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H26584925\">",
"      <span class=\"h1\">",
"       What are the symptoms of pityriasis rosea?",
"      </span>",
"      &nbsp;&mdash;&nbsp;In many people, the rash starts with 1 round or oval patch. This spot is about the size of a half dollar but might be larger. A day or two later, many smaller spots about the size of a dime appear. But not everyone gets the large spot before the rest of the rash.",
"     </p>",
"     <p>",
"      If you have light skin, the spots are usually pink or salmon-colored. If you have dark skin, the spots can be a red-brown color or darker than your skin (",
"      <a class=\"graphic graphic_picture graphicRef65314 \" href=\"UTD.htm?2/35/2612\">",
"       picture 1",
"      </a>",
"      ).",
"     </p>",
"     <p>",
"      The spots might be:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        On the belly, back, chest, arms, and legs",
"       </li>",
"       <li>",
"        Spread out in a &ldquo;Christmas tree&rdquo; pattern on the back",
"       </li>",
"       <li>",
"        Itchy",
"       </li>",
"       <li>",
"        A little scaly",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      In children, the spots sometimes happen on the face and scalp.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H26584940\">",
"      <span class=\"h1\">",
"       Is there a test for pityriasis rosea?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Maybe. Your doctor or nurse will often be able to tell if you have it by learning about your symptoms and doing an exam. But he or she might gently scrape the rash or do a different test to get a sample of your skin. Tests on the skin sample can help the doctor tell if you have pityriasis rosea or a different disease.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H26584955\">",
"      <span class=\"h1\">",
"       Is there anything I can do on my own to feel better?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. You can:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Take a special kind of bath called an oatmeal bath. Use lukewarm, not hot water.",
"       </li>",
"       <li>",
"        Use unscented moisturizing lotion or cream on your skin.",
"       </li>",
"       <li>",
"        Keep your body cool.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H26584970\">",
"      <span class=\"h1\">",
"       How is pityriasis rosea treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Most people do not need any treatment. If the symptoms bother you, your doctor might prescribe creams or ointments to help with itching. In rare cases, doctors prescribe other medicines or a special type of treatment that uses lights, called &ldquo;phototherapy.&rdquo;",
"     </p>",
"    </div>",
