"     </li>",
"     <li>",
"      Differin Gel (AT, BE, CH, DE, GB, IE, IL, IT, SE);",
"     </li>",
"     <li>",
"      Differine (CZ, ES, FR);",
"     </li>",
"     <li>",
"      Doulishu (TW);",
"     </li>",
"     <li>",
"      Easy Acne (TW);",
"     </li>",
"     <li>",
"      Evalen (ID);",
"     </li>",
"     <li>",
"      Klenzit (PH);",
"     </li>",
"     <li>",
"      Klenzit-MS (PH);",
"     </li>",
"     <li>",
"      Panalene (AR);",
"     </li>",
"     <li>",
"      Redap (DK);",
"     </li>",
"     <li>",
"      Rozac (IN);",
"     </li>",
"     <li>",
"      T3ADA (MY);",
"     </li>",
"     <li>",
"      Tifforly Gel (HK);",
"     </li>",
"     <li>",
"      Zudenina (CO);",
"     </li>",
