"      Zudenina F (CO)",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block pha drugH1Div\" id=\"F130528\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Retinoid-like compound which is a modulator of cellular differentiation, keratinization, and inflammatory processes, all of which represent important features in the pathology of acne vulgaris",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F130540\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Onset: 8-12 weeks",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption: Topical: Minimal",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Bile",
"    </p>",
"   </div>",
"  </div>",
