var title_f16_60_17352="Pathophysiologic pathways involved in emesis";
var content_f16_60_17352=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PALC%2F87723&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PALC%2F87723&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 507px\">",
"   <div class=\"ttl\">",
"    Pathophysiologic pathways involved in emesis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 487px; height: 707px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Emesis is mediated centrally by two separate &ldquo;centers&rdquo;. The chemoreceptor trigger zone (CTZ) is localized to the area postrema in the floor of the fourth ventricle where chemosensitive nerve cell projections are bathed by cerebrospinal fluid that is in equilibrium with blood in the fenestrated local capillaries. Neural pathways project from the CTZ to the nucleus tractus solitarius and the reticular formation of the medulla oblongata, which is the location of the vomiting center (VC). The VC is a diffuse, interconnecting neural network that integrates emetogenic stimuli with parasympathetic and motor efferent activity to produce the vomiting reflex. It receives afferents from the cerebral cortex and higher brainstem, thalamus and hypothalamus, the vestibular system, and via the vagus and splanchnic nerves, the pharynx, gastrointestinal tract, serosae, and other thoracoabdominal organs.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
