var title_f16_60_17356="Variants hereditary hemochromatosis";
var content_f16_60_17356=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F56329&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F56329&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Genetic causes of hemochromatosis, iron overload, and hyperferritinemia",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Type",
"       </td>",
"       <td class=\"subtitle1\">",
"        Inheritance",
"       </td>",
"       <td class=\"subtitle1\">",
"        Clinical characteristics",
"       </td>",
"       <td class=\"subtitle1\">",
"        Genetic defect(s)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        I",
"       </td>",
"       <td rowspan=\"2\">",
"        AR",
"       </td>",
"       <td>",
"        Low penetrance,&nbsp;clinical onset&nbsp;in adults",
"       </td>",
"       <td rowspan=\"2\">",
"        HFE protein",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Classical hereditary hemochromatosis",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        II",
"       </td>",
"       <td rowspan=\"2\">",
"        AR",
"       </td>",
"       <td rowspan=\"2\">",
"        Rapid iron loading, full penetrance, and early onset of hypogonadism and cardiac complications. Liver disease less prominent. Also termed \"",
"        <strong>",
"         juvenile hemochromatosis",
"        </strong>",
"        .\" Onset in children or young adult.",
"       </td>",
"       <td>",
"        Hemojuvelin (IIA)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hepcidin (IIB)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        III",
"       </td>",
"       <td>",
"        AR",
"       </td>",
"       <td>",
"        Rare condition described in only eight families to date. Clinically similar to classical HH, but with onset in young adults.",
"       </td>",
"       <td>",
"        Transferrin receptor 2",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        IV",
"       </td>",
"       <td>",
"        AD",
"       </td>",
"       <td>",
"        Variable disorder. Families with loss-of-function mutations&nbsp;have high ferritin levels, increased macrophage iron, reduced transferrin saturation, mild anemia and minimal hepatic iron deposition (\"Ferroportin disease\"). Other families with gain-of-function mutations&nbsp;have findings similar to classical HH.",
"       </td>",
"       <td>",
"        Ferroportin 1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        V",
"       </td>",
"       <td>",
"        AD",
"       </td>",
"       <td>",
"        Found in four of seven members in a single Japanese family.",
"       </td>",
"       <td>",
"        H-ferritin",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        VI",
"       </td>",
"       <td>",
"        AD",
"       </td>",
"       <td>",
"        High levels of ferritin in association with bilateral congenital cataract; no iron deposition. Also termed \"",
"        <strong>",
"         hereditary hyperferritinemia-cataract syndrome",
"        </strong>",
"        .\" Other mutations may lead to \"Benign hyperferritinemia\" without other manifestations.",
"       </td>",
"       <td>",
"        L-ferritin",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     AR: autosomal recessive; AD: autosomal dominant.",
"    </div>",
"    <div class=\"reference\">",
"     Compiled from multiple sources. See text for details and references.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
