var title_f16_60_17358="Abdominl stab wound management algorithm";
var content_f16_60_17358=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F52480&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F52480&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Management of abdominal stab wounds",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 375px; height: 302px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     CT: computed tomography; DL: diagnostic laparoscopy; DPL: diagnostic peritoneal lavage; GIB: gastrointestinal bleed; LWE: local wound exploration; SE: serial examination; US: ultrasound.",
"     <br>",
"      * Clinical indications (and potential caveats) for emergent laparotomy include:",
"      <br>",
"       -",
"       <strong>",
"        Hemodynamic instability",
"       </strong>",
"       (hemothorax/ pneumothorax/ hemopericardium may be alternative or contributory cause)",
"       <br>",
"        -",
"        <strong>",
"         Peritonal signs",
"        </strong>",
"        (can be insensitive, especially early after injury)",
"        <br>",
"         -",
"         <strong>",
"          Implement-in-situ",
"         </strong>",
"         (patients with severe co-morbidities or pregnancy should not undergo laparotomy if it can be avoided)",
"         <br>",
"          -",
"          <strong>",
"           Evisceration",
"          </strong>",
"          (up to one-third do not have intraperitoneal injury)",
"          <br>",
"           -",
"           <strong>",
"            GIB especially for LUQ wounds",
"           </strong>",
"           (uncommon cause for laparotomy).",
"           <br>",
"            &bull; Generally reserved for use when sites of entry put diaphragm at risk.",
"           </br>",
"          </br>",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Adapted with permission from: Isenhour, JL, Marx, J. Advances in abdominal trauma. Emergency Clinics of North America 2007; 25:713. Copyright &copy; 2007 Elsevier.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
